import React from 'react';

class Button extends React.Component {
  constructor() {
    super()
    this.state = {
      count: 0
    }
  }

  render() {
   function incrementCount() {
      this.setState({
        count: this.state.count + 1
      })
    }
    return (
      <>
      <button onClick={() => this.incrementCount}>{this.state.count}</button>
      </>
    )
  }
}

export default Button;
